import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

// Import your existing components
import Navbar from './Components/modern_navbar.js';
import BroadcastBooth from './Components/BroadcastBooth.js';
import ConferencePage from './Components/ConferencePage.js';
import TeamPage from './Components/TeamPage.js';
import GamePage from './Components/GamePage.js';
import CommunityChat from './Components/CommunityChat.js';
import TriviaGame from './Components/TriviaGame.js';
import Registration from './Components/Registration.js';
import SubscriptionModal from './Components/SubscriptionModal.js';

// Import CSS files
import './Components/modern_navbar.css';
import './Components/BroadcastBooth.css';
import './Components/ConferencePage.css';
import './Components/TeamPage.css';
import './Components/GamePage.css';
import './Components/CommunityChat.css';
import './Components/TriviaGame.css';

function App() {
  const [showSubscriptionModal, setShowSubscriptionModal] = useState(false);
  const [user, setUser] = useState(null);

  // Check for returning users
  useEffect(() => {
    const savedUser = localStorage.getItem('cfb_user');
    if (savedUser) {
      setUser(JSON.parse(savedUser));
    }
  }, []);

  const handleSubscription = (plan) => {
    console.log('Selected plan:', plan);
    setShowSubscriptionModal(false);
    // Handle subscription logic here
  };

  const handleRegistration = (userData) => {
    setUser(userData);
    localStorage.setItem('cfb_user', JSON.stringify(userData));
  };

  return (
    <Router>
      <div className="App">
        <Navbar 
          user={user} 
          onSubscriptionClick={() => setShowSubscriptionModal(true)}
        />
        
        <Routes>
          {/* Homepage - Broadcast Booth */}
          <Route 
            path="/" 
            element={
              <BroadcastBooth 
                user={user}
                onSubscriptionClick={() => setShowSubscriptionModal(true)}
              />
            } 
          />
          
          {/* Registration */}
          <Route 
            path="/register" 
            element={
              <Registration 
                onRegistrationComplete={handleRegistration}
              />
            } 
          />
          
          {/* Conference Pages */}
          <Route path="/conferences" element={<ConferencePage />} />
          <Route path="/sec" element={<ConferencePage conference="SEC" />} />
          <Route path="/big-ten" element={<ConferencePage conference="Big Ten" />} />
          <Route path="/big-12" element={<ConferencePage conference="Big 12" />} />
          <Route path="/acc" element={<ConferencePage conference="ACC" />} />
          <Route path="/pac-12" element={<ConferencePage conference="Pac-12" />} />
          
          {/* Team Pages */}
          <Route path="/team/:teamId" element={<TeamPage />} />
          
          {/* Game Analysis */}
          <Route path="/game/:gameId" element={<GamePage />} />
          <Route path="/games" element={<GamePage />} />
          
          {/* Community Features */}
          <Route 
            path="/community" 
            element={
              <CommunityChat 
                user={user}
                onSubscriptionClick={() => setShowSubscriptionModal(true)}
              />
            } 
          />
          
          {/* Trivia Game */}
          <Route 
            path="/trivia" 
            element={
              <TriviaGame 
                user={user}
                onSubscriptionClick={() => setShowSubscriptionModal(true)}
              />
            } 
          />
          
          {/* Catch-all redirect to home */}
          <Route path="*" element={<BroadcastBooth />} />
        </Routes>

        {/* Subscription Modal */}
        {showSubscriptionModal && (
          <SubscriptionModal
            onClose={() => setShowSubscriptionModal(false)}
            onSubscribe={handleSubscription}
            user={user}
          />
        )}
      </div>
    </Router>
  );
}

export default App;
